import logo from "./assets/logo.svg";

const Header = () => {
  return (
    <div>
      <div class="container">
        <header class="header">
          <img src={logo} alt="Honor logo" class="logo" />;
          <nav class="user-nav">
            <div class="nav-item">ganadores</div>
            <div class="nav-item">facturas</div>
            <div class="nav-item">contacto</div>
            <button class="nav-item btn">participa</button>
          </nav>
        </header>
      </div>
    </div>
  );
};

export default Header;
